/* VCD dumping functions */
MOD_mktop_pipelined & mktop_pipelined_backing(tSimStateHdl simHdl)
{
  static MOD_mktop_pipelined *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mktop_pipelined(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mktop_pipelined::dump_VCD_defs()
{
  (mktop_pipelined_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mktop_pipelined::dump_VCD(tVCDDumpType dt)
{
  (mktop_pipelined_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mktop_pipelined_backing(sim_hdl));
}
